import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import authService from '../services/authService';
import { useAuth } from '../context/AuthContext';

const SettingsPage = () => {
  // State untuk form ganti password
  const [passwordData, setPasswordData] = useState({
    oldPassword: '',
    newPassword: '',
    confirmNewPassword: ''
  });
  // State untuk form ganti username
  const [newUsername, setNewUsername] = useState('');

  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');
  const { updateUsername } = useAuth();

  const onPasswordChange = (e) => setPasswordData({ ...passwordData, [e.target.name]: e.target.value });
  const onUsernameChange = (e) => setNewUsername(e.target.value);

  const handlePasswordSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setSuccess('');
    if (passwordData.newPassword !== passwordData.confirmNewPassword) {
      return setError('Password baru dan konfirmasi tidak cocok!');
    }
    try {
      const response = await authService.updatePassword({ oldPassword: passwordData.oldPassword, newPassword: passwordData.newPassword });
      setSuccess(response.message);
      setPasswordData({ oldPassword: '', newPassword: '', confirmNewPassword: '' });
    } catch (err) {
      setError(err.message || 'Gagal memperbarui password.');
    }
  };

  const handleUsernameSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setSuccess('');
    try {
      const response = await updateUsername({ newUsername });
      setSuccess(response.message);
      setNewUsername('');
    } catch (err) {
      setError(err.message || 'Gagal memperbarui username.');
    }
  };

  return (
    <div className="form-container">
      <Link to="/" className="back-link">← Kembali ke Dashboard</Link>

      {/* FORM GANTI PASSWORD */}
      <h1>Ganti Password</h1>
      <form onSubmit={handlePasswordSubmit}>
        <div className="form-group">
          <label htmlFor="oldPassword">Password Saat Ini</label>
          <input type="password" name="oldPassword" value={passwordData.oldPassword} onChange={onPasswordChange} required />
        </div>
        <div className="form-group">
          <label htmlFor="newPassword">Password Baru</label>
          <input type="password" name="newPassword" value={passwordData.newPassword} onChange={onPasswordChange} required />
        </div>
        <div className="form-group">
          <label htmlFor="confirmNewPassword">Konfirmasi Password Baru</label>
          <input type="password" name="confirmNewPassword" value={passwordData.confirmNewPassword} onChange={onPasswordChange} required />
        </div>
        <button type="submit" className="btn-block">Update Password</button>
      </form>

      <hr className="divider" />

      {/* FORM GANTI USERNAME */}
      <h1>Ganti Username</h1>
      <form onSubmit={handleUsernameSubmit}>
        <div className="form-group">
          <label htmlFor="newUsername">Username Baru</label>
          <input type="text" name="newUsername" value={newUsername} onChange={onUsernameChange} required />
        </div>
        <button type="submit" className="btn-block">Update Username</button>
      </form>

      {/* Pesan Error & Sukses */}
      {error && <div className="message error" style={{ marginTop: '1rem' }}>{error}</div>}
      {success && <div className="message success" style={{ marginTop: '1rem' }}>{success}</div>}
    </div>
  );
};

export default SettingsPage;
